import React from "react";

const Cars = () => {
  // Example car data (later you can fetch from backend or API)
  const cars = [
    {
      id: 1,
      name: "Toyota Corolla",
      price: "$15,000",
      image: "https://via.placeholder.com/400x250?text=Toyota+Corolla",
      location: "Nairobi, Kenya",
    },
    {
      id: 2,
      name: "Honda Civic",
      price: "$18,500",
      image: "https://via.placeholder.com/400x250?text=Honda+Civic",
      location: "Mombasa, Kenya",
    },
    {
      id: 3,
      name: "BMW 3 Series",
      price: "$35,000",
      image: "https://via.placeholder.com/400x250?text=BMW+3+Series",
      location: "Kisumu, Kenya",
    },
    {
      id: 4,
      name: "Mercedes-Benz C-Class",
      price: "$42,000",
      image: "https://via.placeholder.com/400x250?text=Mercedes+C+Class",
      location: "Nakuru, Kenya",
    },
  ];

  return (
    <div className="container my-5">
      <div className="text-center mb-4">
        <h1 className="fw-bold text-primary">ðŸš— Available Cars</h1>
        <p className="text-muted">Browse through our latest collection of cars</p>
      </div>

      <div className="row">
        {cars.map((car) => (
          <div className="col-md-3 mb-4" key={car.id}>
            <div className="card shadow-sm h-100">
              <img
                src={car.image}
                className="card-img-top"
                alt={car.name}
                style={{ height: "180px", objectFit: "cover" }}
              />
              <div className="card-body">
                <h5 className="card-title">{car.name}</h5>
                <p className="card-text">
                  <strong>Price:</strong> {car.price}
                  <br />
                  <strong>Location:</strong> {car.location}
                </p>
              </div>
              <div className="card-footer text-center">
                <button className="btn btn-success btn-sm w-100">
                  View Details
                </button>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Cars;
